import React from 'react'

function Aboutus() {
    return (
        <div className='container'>
            <h1 style={{ color: "red", textAlign: "center" }}>This is about me page</h1>
            <div className= 'textcontainer'> </div>
            
            <img src='pic1.jpeg' style={{ Width: "30%",margin: "10px 400px", height: "400px" }} />
        </div>
    )
}

export default Aboutus
